import React from 'react';
import CartList from './CartList';

const Cart = ({ sentCart, checkoutStart, loadCart }) => {

    return (
        <div style={{padding: "10%"}}>
        { loadCart ? (<><CartList sentCart={sentCart}/><br /><button onClick={checkoutStart} class="btn btn-primary">Checkout</button></>) : ("You have no items") }
        </div>
    )
}

export default Cart;
